def make_good_pop(wld, target, diff, size):

  wld_far = {}
  for s in wld:
    if abs(wld[s]-target)>diff:
      wld_far[s]=wld[s]
   
  
  population = []
  scores = []
  for s in wld_far:
    population.append(s)
    a = abs(wld_far[s]-target)
    b = -a
    scores.append(b)
  
  population_tuples = list(zip(scores,population))
  population_tuples = sorted(population_tuples, key=lambda x: x[0], reverse=True)[:size]
  population = [t[1] for t in population_tuples]
  scores = [t[0] for t in population_tuples]
  
  w = []
  for s in population:
    w.append(wld[s]) 

  return(population, w)

